import React from 'react';
import { SafeAreaView } from 'react-native';
import Navigator from './NewsFeed'

export default function Feed() {
  return (
    <SafeAreaView style={global.backgroundColor}>
      < Navigator />
    </SafeAreaView>
  );
}
